package com.example.Quora.models;import jakarta.persistence.*;import lombok.*;import java.util.List;@Entity@Getter@Setter@NoArgsConstructor@AllArgsConstructor@Builderpublic class Question {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private  Long id;    @Column(nullable = false)    private String question;    @Column(nullable = false)    private String content;    @ManyToOne    private User user;    @Override    public String toString() {        return "Question{" +                "id=" + id +                ", question='" + question + '\'' +                ", content='" + content + '\'' +                ", user=" + user +                ", comment=" + comment +                ", likes=" + likes +                ", answers=" + answers +                '}';    }    @OneToMany(mappedBy = "question")    private List<Comment> comment;    @OneToMany(mappedBy = "question")    private List<Like> likes;    @OneToMany(mappedBy = "question")    private List<Answer> answers;}